import React from 'react';


export default function Navbar()
{
    return(
        <div className='herosection py-2'>
        <nav className='d-flex flex-row justify-content-between'>
            < span >
                ResumeAnalyzer
            </ span>
        <div className='d-flex flex-row'>
            <span className='max-4 nav-items'>
                Products</span>
            <span className='max-4 nav-items'>
                Login </span>

        </div>

        </nav>
        </div>
        
        )
}
